import React from "react";
import './Learn.scss';

import Card from 'react-bootstrap/Card';
import Carousel from 'react-bootstrap/Carousel';

import Kemley from '../assets/Kemley.jpeg';
import Sabrina from '../assets/Sabrina.jpg';
import Esteban from '../assets/Esteban.png';
import chart from "../assets/chart.png";
import ball from '../assets/ball.png';
import book from '../assets/about.png';

export class Learn extends React.Component {
    render() {
        return (
            <div className="learn">
                <div className="learn-section">
                    <h2 className="learn-section-tittle">Who We Are</h2>
                    <div className="learn-section-flex">
                        <div className="learn-card">
                        <div className="learn-card-top">
                        <h2>For Loops</h2>
                        </div>
                            <span className="learn-card-title">Kemley Nieva</span>
                            <p className="learn-card-text"> "I was born in New York, but raised in Miami,FL. My family is from Colombia.
                                            Currently, I attend the University of Florida as a fourth year Computer Science student with a minor in Busniess Administration.
                                            After gradution, I will be moving to Seattle to join full-time with Microsoft as a Project Manager."</p>
                        </div>
                        <div className="learn-card">
                            <img className="learn-card-img" src={Kemley} />
                            <span className="learn-card-title">Kemley Nieva</span>
                            <p className="learn-card-text"> "I was born in New York, but raised in Miami,FL. My family is from Colombia.
                                            Currently, I attend the University of Florida as a fourth year Computer Science student with a minor in Busniess Administration.
                                            After gradution, I will be moving to Seattle to join full-time with Microsoft as a Project Manager."</p>
                        </div>
                        <div className="learn-card">
                            <img className="learn-card-img" src={Kemley} />
                            <span className="learn-card-title">Kemley Nieva</span>
                            <p className="learn-card-text"> "I was born in New York, but raised in Miami,FL. My family is from Colombia.
                                            Currently, I attend the University of Florida as a fourth year Computer Science student with a minor in Busniess Administration.
                                            After gradution, I will be moving to Seattle to join full-time with Microsoft as a Project Manager."</p>
                        </div>
                    </div>
                </div>
            </div>
        );
    }
}
